import React from 'react';
import { Field,Form, Formik } from 'formik';

const Form2 = () => {
    return (
        <div>
            <h1></h1>
            <Formik>
                <Form>
                    <label>First Name</label>
                    <Field name="firstName" type="text"/>
                </Form>
            </Formik>
        </div>
    );
};

export default Form2;
